  store_id INT PRIMARY KEY,
  location VARCHAR(255),
  date DATE,
  foot_traffic_count INT
);

CREATE TABLE store_locations (store_id UUID PRIMARY KEY,
store_name VARCHAR,
address VARCHAR,
phone_number VARCHAR,
manager_name VARCHAR
);

CREATE TABLE store_performance (
  performance_id SERIAL PRIMARY KEY,
  location_id UUID,
  revenue DECIMAL,
  foot_traffic_score INT
);

CREATE TABLE FootTrafficData (
    store_id INT,
    timestamp TIMESTAMP,
    customer_count INT
);

CREATE TABLE StoreLocations (
    store_id INT,
    store_name VARCHAR,
    location_lat DECIMAL,
    location_long DECIMAL
);

CREATE TABLE StoreDetails (
    store_id INT,
    manager_name VARCHAR,
    store_type VARCHAR
);

CREATE TABLE StoreAnalytics (
    store_id INT,
    analysis_id INT,
